import React from "react";

const CartDetails = () => {
  const mystyle = {
    backgroundImage: "url('backgroundimg.jpg')",
    height: "93vh",
    padding: "50px",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  return (
    <div style={mystyle}>
      <h1>CartDetails</h1>
    </div>
  );
};

export default CartDetails;
